import { useState } from 'react';
import './App.css';
import PriceTable from './components/PriceTable';
import Sales from './components/Sales';
function App() {
  const [flag, setFlag] = useState(true);

  const handleClick = (e) => {
    e.target.id === "NFT" ? setFlag(true) : setFlag(false);

  }

  return (
    <div className="App">
      <div className="section">
        <button onClick={e => handleClick(e)} id="NFT">NFT</button> |
        <button onClick={e => handleClick(e)} id="sales">Sales</button>
      </div>
      {flag ? <PriceTable /> : <Sales />}
    </div>

  );
}

export default App;
